// Reviews.jsx
import React from 'react';

const Reviews = ({ reviews }) => (
  <div>
    <h3>Reviews</h3>
    <div>
      {reviews.map(review => (
        <div key={review.id}>
          <p>{review.summary}</p>
          <a href={`/content/${review.contentId}`}>Read More</a>
        </div>
      ))}
    </div>
  </div>
);

export default Reviews;
